import { Link } from "react-router-dom";
import "./tailwind.css";

import bird from "./images/daily/image.webp";

export const Top = () => {
  return (
    <>
      <div>
        <div class="flex py-8  relative flex">
          <div class="absolute text-white float-left">
            日報を共有して、新たな発見に出会う
          </div>
          <img class="object-contain h-full" src={bird} alt="imgaes" />
          {/* </div>
        <div class="flex py-8 justify-center"> */}
          <Link
            class="p-4 bg-blue-300 rounded-lg text-white absolute justify-self-center"
            to="/daily"
          >
            日報を見る
          </Link>
        </div>
      </div>
    </>
  );
};
